import ReactDOM from "react-dom";
import './app.css'
// A functional Component
function App () {
  const data = "i have brought my ashi baby to dubai"
return(
  <div>
  <h1 className="hello">Hello world! </h1>
  <p>I am gooing to became successfull. i have got job of salary above 1 lakh per month in the month of september 2022.
    {data}
  </p>

   </div>
)
}
ReactDOM.render(
 <App></App>,
  document.getElementById("root")
  );
